import React from 'react';
import './App.css';
import classes from './App.css'

import PlayerSection from './PlayerSection'
import PlaylistSection from './PlaylistSection'

function App() {
  return (
    <div className={classes.App}>
      <PlayerSection />
      <PlaylistSection />
    </div>
  );
}

export default App;
